import React, { Component } from "react";
import Logo from './Logo.png'
import "./App.css";

class Navbar extends Component {
    render(){
        return(
        <div className='Navbar'>
            <img src={Logo} height={40} width={160} />
            <div className='Links'>
                <a href="#">Home</a>
                <a href="#">Projects</a>
                <a href="#">About</a>
                <a href="#">Contacts</a>
            </div>
            <div className='Links'>
                <h4>Social</h4>
                <a href="#">TW</a>
                <a href="#">IG</a>
                <a href="#">BE</a>
            </div>
        </div>
        )
    }
}

export default Navbar
